import React from "react";
import { motion } from "framer-motion";
import "./App.css";

function App() {
  return (
    <div className="container">
      <motion.header
        className="hero"
        initial={{ opacity: 0, y: -50 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8 }}
      >
        <h1>AI Research Matchmaking</h1>
        <p>Connecting researchers with the perfect collaborations.</p>
        <motion.button
          className="explore-btn"
          whileHover={{ scale: 1.1 }}
          whileTap={{ scale: 0.9 }}
        >
          Get Started
        </motion.button>
      </motion.header>
    </div>
  );
}

export default App;
